import { FaTimes } from "react-icons/fa";
const Task = ({ task }) => {
  const onClick = () => {
    {
      task.filter((task) => {
        task.id !== task.id;
      });
    }
  };
  return (
    <div className="task">
      <h3>
        {task.text} <FaTimes color="red" onClick={onClick} />
      </h3>
      <p>{task.day}</p>
    </div>
  );
};

export default Task;
